import React from 'react';

const Hello = () => {
    // return (
    //     <div>
    //         <h1>Hello Okky</h1>
    //     </div>
    // )
    return React.createElement(
      "div",
      null,
      React.createElement("h1", "Hello Okky")
    );
}

export default Hello
